description:
AIDA64 Extreme is a streamlined Windows diagnostic and benchmarking software for home users, hardware enthusiasts and overclockers. AIDA64 Extreme provides a wide range of features to assist in overclocking, hadware error diagnosis, stress testing, and sensor monitoring. It has unique capabilities to assess the performance of the processor, system memory, disk drives, and OpenCL-capable GPUs. AIDA64 is compatible with all current 32-bit and 64-bit Microsoft Windows operating systems, including Windows 8.1 and Windows Server 2012 R2.

 What's new in this version: Simultaneously with the introduction of its revamped business product range, FinalWire announced the availability of AIDA64 v4.00. Besides offering support for the latest and upcoming hardware devices, the new AIDA64 release introduces a complete set of multi-threaded OpenCL GPGPU benchmarks to measure the computing performance of modern graphics processors and APUs.

